import React, { Component } from 'react';

class main extends Component {
  render() {

    const changecolor = {
      fontSize: '15rem',
      color: 'orange'
    };

    return (
      <div>
        <h1 style={changecolor}>Hello Adil</h1>
      </div>
    );
  }
}

export default main;
